tables.table_schema:
CREATE TABLE weather_data (
    date DATE,
    temperature FLOAT,
    humidity FLOAT,
    weather_condition VARCHAR(255)
);

CREATE TABLE WeatherData (
    date DATE,
    location VARCHAR,
    temperature FLOAT,
    humidity FLOAT
);

CREATE TABLE EnergyConsumption (
    date DATE,
    location VARCHAR,
    energy_usage FLOAT,
    system_type VARCHAR
);

CREATE TABLE HeatingSystems (
    system_id INT,
    system_type VARCHAR,
    installation_date DATE,
    efficiency FLOAT
);

CREATE TABLE CoolingSystems (
    system_id INT,
    system_type VARCHAR,
    installation_date DATE,
    efficiency FLOAT
);

CREATE TABLE EnergyOptimization (
    optimization_id INT,
    date DATE,
    location VARCHAR,
    optimization_type VARCHAR
);
